import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content';
import link from '../assets/images/link.svg';
import inst from '../assets/images/inst.svg';
import face from '../assets/images/face.svg';
import mail from '../assets/images/mail.svg';


function ContactPage (props){

        return(
            <div className="contactcss">
                <Hero title={props.title} /> 
                <Content>
                    <span>If you have any question, make sure to send me message.
                        </span>
                <h1></h1>
                <a href="mailto:gaofengyin@hotmail.com"> <img className="link" src={mail} alt="img" /></a>
                <img className="link" src={link} alt="img" />
                <img className="link" src={inst} alt="img" />
                <img className="link" src={face} alt="img" />

                </Content>
            </div>
        );

}

export default ContactPage;
